import React from "react";

const Pro = () => {
  return (
    <div
      style={{
        alignItems: "center",
        display: "flex",
        justifyContent: "center",
      }}
    >
      <div style={{ width: "80%" }}>
        <div
          style={{
            alignItems: "center",
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div style={{ fontSize: "60px", fontWeight: "700" }}>
            <span style={{ color: "red" }}>air</span>cover
          </div>
          <div style={{ fontSize: "20px", fontWeight: "400" }}>forHost</div>
          <div style={{ fontSize: "40px", fontWeight: "700" }}>
            Airbnb it with top‑to‑bottom protection
          </div>
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            gap: "100px",
            paddingLeft: "530px",
            paddingTop: "40px",
            paddingBottom: "20px",
          }}
        >
          <div style={{ fontSize: "26px", fontWeight: "400" }}>Airbnb</div>
          <div style={{ fontSize: "26px", fontWeight: "400" }}>Competitors</div>
        </div>
        <hr style={{ opacity: "0.6" }} />
        <div style={{width:"100%"}}>
        <div style={{display:"flex",flexDirection:"column",width:"50%",gap:"20px",paddingTop:""}}>
          <div>Guest identity verification</div>
          <div>
            Our comprehensive verification system checks details such as name,
            address, government ID and more to confirm the identity of guests
            who book on Airbnb.
          </div>
        </div>
        </div>
      </div>
    </div>
  );
};

export default Pro;
